import React from "react";
import { PROJECTS } from "./projects";

const Project = ({ project }) => {
  const selectedProject = PROJECTS.find((p) => p.name === project.name);
  return (
    <div className="responsive-text not-fancy-font flex flex-col gap-5">
      <div className="flex flex-col gap-3 items-center">
        <a
          target="_blank"
          href={selectedProject.live}
          className="animate__animated animate__fadeInDown"
          rel="noreferrer"
        >
          {selectedProject.name}
        </a>

        <div className="text-20">{selectedProject.description}</div>
      </div>
      <div className="mb-10 flex flex-col gap-3">
        <a href={selectedProject.live} target="_blank" rel="noreferrer">
          <img src={selectedProject.image} alt={selectedProject.name} />
        </a>
         <div>
          <div className="text-md">Tech Stack: </div>
         </div>
      </div>
    </div>
  );
};

export default Project;
